/**
 * **Tavoletta** is the client of our player for the
 * [**AI Tablut Challenge 2022**](https://ai.unibo.it/games/boardgamecompetition/tablut/2122INF).
 * We know you're reading this, you're free to "copy" it, just don't make it too obvious.<br></br>You can find the complete
 * source code of the project [here](https://github.com/Gionnino9000/Gionnino9000).
 *
 * @see [this](https://github.com/Gionnino9000/Gionnino9000.spiegazione-del-nome) for the name explaination,
 * even though we hope you don't need it. If you do and still don't get it, just know that we hate you.
 *
 *
 * @author **Team Gionnino9000**
 * ([Federico Andrucci](https://github.com/Federicoand98), [Karina Chichifoi](https://github.com/TryKatChup),
 * [Alex Gianelli](https://github.com/Noesh), [Michele Righi](https://github.com/mikyll))
 */
class Tavoletta
/**
 * Main constructor
 *
 * @param player    the side the player plays for [WHITE | BLACK]
 * @param name      the name of the team
 * @param timeout   the maximum number of seconds the player has to choose its next move
 * @param ipAddress the server address
 * @param game      the game rules [1 - BasicTablut | 2 - ModernTablut | 3 - BrandubTablut | **4 - AshtonTablut**]
 * @param debug     enable debug prints (show the depth of the search and information about the expanded nodes)
 *
 * @throws UnknownHostException if the IP address of the host could not be determined.
 * @throws IOException if an I/O error occurs when creating the socket.
 */(player: String, name: String, timeout: Int, ipAddress: String?, private val game: Int, private val debug: Boolean) :
    TablutClient(
        player,
        name,
        timeout,
        ipAddress
    ) {

    override fun run() {
        GOTavolettaDoTheMagicAndShine()

        // Send marvelous name to the server
        try {
            declareName()
        } catch (e: Exception) {
            e.printStackTrace()
        }
        var state: State = StateTablut()
        state.turn=(Turn.WHITE) // WHITE makes the first move
        val tablut = GameAshtonTablut(0, -1, "logs", "white_ai", "black_ai")
        while (true) {
            try {
                // Receive the state from the Server
                read()
            } catch (e: IOException) {
                e.printStackTrace()
                exitProcess(2)
            }

            // Update the state received
            state = currentState!!
            println(TEAM_NAME.uppercase(Locale.getDefault()) + ": " + PLAYER_NAME + " dice \"bro pastati sto stato\" ")
            println(state.toString())

            // WHITE turn
            if (player == Turn.WHITE) {
                if (state.turn == Turn.WHITE) {
                    println(TEAM_NAME.uppercase(Locale.getDefault()) + ": " + PLAYER_NAME + " dice \"sto pensando alla prossima mossa, mhhhhhh...\"")
                    val a = findBestMove(tablut, state)
                    println(TEAM_NAME.uppercase(Locale.getDefault()) + ": " + PLAYER_NAME + " dice \"proviamo a fare sta mossa: " + a.toString() + "\"")
                    try {
                        write(a)
                    } catch (e: IOException) {
                        e.printStackTrace()
                    }
                } else if (state.turn == Turn.BLACK) {
                    // Opponent TURN
                    println(TEAM_NAME.uppercase(Locale.getDefault()) + ": " + PLAYER_NAME + " dice che dobbiamo aspettare il turno dell'avversario... Dai sbrigati bro...")
                } else if (state.turn == Turn.WHITEWIN) {
                    // if WHITE win
                    println(TEAM_NAME.uppercase(Locale.getDefault()) + ": " + PLAYER_NAME + " dice \"abbiamo vinto! POG, dammi le mie spaccamascella! üç¨üç≠\"")
                    exitProcess(0)
                } else if (state.turn == Turn.BLACKWIN) {
                    // if BLACK win
                    println(TEAM_NAME.uppercase(Locale.getDefault()) + ": " + PLAYER_NAME + " dice \"abbiamo perso... Kinda sus, mi sa che qualcuno qui ha barato...\"")
                    exitProcess(0)
                } else if (state.turn == Turn.DRAW) {
                    println(TEAM_NAME.uppercase(Locale.getDefault()) + ": " + PLAYER_NAME + " dice \"pareggio, onesto.\"")
                    exitProcess(0)
                }
            } else {
                if (state.turn == Turn.BLACK) {
                    println(TEAM_NAME.uppercase(Locale.getDefault()) + ": " + PLAYER_NAME + " dice \"sto pensando alla prossima mossa, mhhhhhh...\"")
                    val a = findBestMove(tablut, state)
                    println(TEAM_NAME.uppercase(Locale.getDefault()) + ": " + PLAYER_NAME + " dice \"proviamo a fare sta mossa: " + a.toString() + "\"")
                    try {
                        write(a)
                    } catch (e: IOException) {
                        e.printStackTrace()
                    }
                } else if (state.turn == Turn.WHITE) {
                    // Opponent TURN
                    println(TEAM_NAME.uppercase(Locale.getDefault()) + ": " + PLAYER_NAME + " dice che dobbiamo aspettare il turno dell'avversario... Dai sbrigati bro...")
                } else if (state.turn == Turn.BLACKWIN) {
                    // if WHITE win
                    println(TEAM_NAME.uppercase(Locale.getDefault()) + ": " + PLAYER_NAME + " dice \"abbiamo vinto! POG, dammi le mie spaccamascella! üç¨üç≠\"")
                    exitProcess(0)
                } else if (state.turn == Turn.WHITEWIN) {
                    // if BLACK win
                    println(TEAM_NAME.uppercase(Locale.getDefault()) + ": " + PLAYER_NAME + " dice \"abbiamo perso... Kinda sus, mi sa che qualcuno qui ha barato...\"")
                    exitProcess(0)
                } else if (state.turn == Turn.DRAW) {
                    println(TEAM_NAME.uppercase(Locale.getDefault()) + ": " + PLAYER_NAME + " dice \"pareggio, onesto.\"")
                    exitProcess(0)
                }
            }
        }
    }

    private fun findBestMove(tablutGame: GameAshtonTablut, state: State?): Action {
        val search = TavolettaSearch(tablutGame, Double.MIN_VALUE, Double.MAX_VALUE, super.timeout - 2)
        search.setLogEnabled(debug)
        return search.makeDecision(state)
    }

    companion object {
        const val TEAM_NAME = "Gionnino9000"
        const val PLAYER_NAME = "Tavoletta"
        @Throws(IOException::class)
        @JvmStatic
        fun main(args: Array<String>) {
            val gameType = 4
            var role = ""
            var ip = "localhost"
            var timeout = 60
            var deb = false
            if (args.isEmpty()) {
                //print(/* !!! Hit visitElement for element type: class org.jetbrains.kotlin.nj2k.tree.JKErrorExpression !!! */)
                exitProcess(1)
            } else {
                role = args[0]
            }
            if (args.size == 2) {
                try {
                    timeout = args[1].toInt()
                } catch (e: NumberFormatException) {
                    e.printStackTrace()
                    //print(/* !!! Hit visitElement for element type: class org.jetbrains.kotlin.nj2k.tree.JKErrorExpression !!! */)
                    exitProcess(1)
                }
            }
            if (args.size == 3) {
                try {
                    timeout = args[1].toInt()
                    ip = args[2]
                } catch (e: NumberFormatException) {
                    e.printStackTrace()
                    //print(/* !!! Hit visitElement for element type: class org.jetbrains.kotlin.nj2k.tree.JKErrorExpression !!! */)
                    exitProcess(1)
                }
            }
            if (args.size == 4) {
                try {
                    timeout = args[1].toInt()
                    ip = args[2]
                } catch (e: NumberFormatException) {
                    e.printStackTrace()
                    //print(/* !!! Hit visitElement for element type: class org.jetbrains.kotlin.nj2k.tree.JKErrorExpression !!! */)
                    exitProcess(1)
                }
                if (args[3] == "debug") {
                    deb = true
                } else {
                    print(
                        """ERROR: The last argument can be only 'debug' and it allow to print logs during search
	USAGE: ./runmyplayer <black|white> <timeout-in-seconds> <server-ip> <debug>"""
                    )
                    exitProcess(1)
                }
            }
            println("Team Gionnino9000\n\nMembers:\n\tFederico Andrucci\n\tKarina Chichifoi\n\tAlex Gianelli\n\tMichele Righi\n")
            println("Player:  $role")
            println("Timeout: $timeout secondi")
            println("Server:  $ip")
            println("Debug:   $deb\n")
            val client = Tavoletta(role, "$PLAYER_NAME (Team $TEAM_NAME)", timeout, ip, gameType, deb)
            client.run()
        }

